ubleshoot a garage door thats not opening properly.";i:33;s:25:"Check the Manual Release.";i:34;s:178:"If you click your remote and hear the garage door openers motor running but the door wont open the first thing you should do is check to see that the manual release isnt engaged.";i:35;s:49:"Usually located towards the front of your garage.";i:36;s:158:"As previously explained if your garage door rollers are not sliding smoothly along the tracks then this can hinder the opening and closing of any garage door.";i:37;s:179:"Check to see if the tracks are distorted out of shape or clogged with debris these are easy fixes but if something more complex has gone wrong call the professionals at Doormatic.";}}